POPULAR QUESTIONS
]
[
Get Answers to Your Questions
]
[
Have questions about the Chiefland Farmers Flea Market? Find answers to the most commonly asked questions about our market, vendors, and more.
]
[
[
What are the operating hours of the Chiefland Farmers Flea Market?
The flea market is open every Friday, Saturday, and Sunday from 8:00 AM to 3:00 PM.
Where is the Chiefland Farmers Flea Market located?
We are located at 1206 N Young Blvd US HWY 19, Chiefland, FL 32626. For directions,
click here
How can I become a vendor at the Chiefland Farmers Flea Market?
To become a vendor, please visit our "Become a Vendor" page for application details and booth rental information.
What types of products can I find at the flea market?
Our market features a diverse range of products including fresh produce, handmade crafts, antiques, collectibles, and specialty foods.
Are pets allowed at the flea market?
Yes, well-behaved pets on leashes are welcome at the flea market. Please ensure your pets are friendly and considerate of other visitors. Additionally, we kindly ask that you pick up after your dog to help keep the market clean and enjoyable for everyone.
